import { Link } from 'react-router-dom';

const Sidebar = () => {
  const rol = localStorage.getItem('usuario');

  return (
    <div className="col-md-2 sidebar bg-white vh-100 border-end p-3">
      <h5 className="text-center mb-4">Menú</h5>

      {rol === 'admin' && (
        <>
          <Link to="/estudiantes" className="d-block mb-2 text-primary">Estudiantes</Link>
          <Link to="/pacientes" className="d-block mb-2 text-primary">Pacientes</Link>
          <Link to="/fichas" className="d-block mb-2 text-primary">Fichas</Link>
          <Link to="/informe" className="d-block mb-2 text-primary">Informe</Link>
        </>
      )}

      {rol === 'estudiante' && (
        <>
          <Link to="/pacientes" className="d-block mb-2 text-primary">Mis Pacientes</Link>
          <Link to="/fichas" className="d-block mb-2 text-primary">Mis Fichas</Link>
        </>
      )}

      <Link to="/" className="d-block text-danger mt-3">Cerrar sesión</Link>
    </div>
  );
};

export default Sidebar;
